import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial_page.png'));

    // 1. Click on a category to go to a product listing page where view controls exist
    await page.waitForSelector('div.category-card:has-text("Electronics")', { timeout: 5000 });
    await page.locator('div.category-card:has-text("Electronics")').click();

    // 2. Wait for the view toggle buttons to appear and take a screenshot of the grid view
    await page.waitForSelector('button[title="List View"]', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_grid_view.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_grid_view.png'));

    // 3. Click the "List View" button
    await page.locator('button[title="List View"]').click();

    // 4. Wait for the product container to switch to list view mode and take a final screenshot
    await page.waitForSelector('.products-list', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_list_view.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_list_view.png'));

    // 5. Extract data to verify the view has changed
    const productContainerClass = await page.locator('.products-list').getAttribute('class');
    const isListViewActive = await page.locator('button[title="List View"]').getAttribute('class');

    return {
      success: true,
      action: "Switched to List View Mode",
      extractedData: {
        productContainerClass: productContainerClass,
        isListViewButtonActive: isListViewActive.includes('active')
      },
      screenshots,
      error: null
    };
  } catch (error) {
    // Take a screenshot on error
    const screenshots = [];
    try {
      const errorScreenshotPath = path.join(screenshotsDir, 'error_screenshot.png');
      await page.screenshot({ path: errorScreenshotPath });
      screenshots.push(errorScreenshotPath);
    } catch (e) {
      console.error("Failed to take error screenshot:", e);
    }

    return {
      success: false,
      action: "Failed to switch to List View Mode",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
